        "duration": 120,
        "synopsis": "Lara Croft es una mujer independiente y aguerrida, hija de un aventurero excéntrico que desapareció inexplicablemente cuando ella era apenas una adolescente. A sus 21 años va por la vida sin un propósito definido y dedica sus días a recorrer las caóticas calles del Este de Londres en bicicleta como mensajero, con un ingreso que apenas cubre el alquiler. También está inscripta a la universidad, pero faltar a casi todas sus clases. Vive con la determinación de seguir su propio camino y se rehúsa vehementemente a heredar el imperio que su padre formó, al igual que a aceptar que su desaparición es definitiva. A pesar de recibir constantemente el consejo de enfrentar los hechos y continuar con su vida tras 7 años sin su padre, ni siquiera Lara es capaz de comprender lo que la impulsa a resolver, de una vez por todas, el enigma de su misteriosa desaparición.",
